  violence service calls received by the Domestic Violence Help Line per month. The
  city has developed a multi-layered response to the domestic violence crisis, including
  the Help Line, services provided by delegate agencies and services provided by advocates
  at our Community Service Centers. DFSS funds approximately 30 community based delegate
  agencies under the Family Violence Prevention Initiative to serve domestic violence
  victims and their children at programs located throughout Chicago.\",\n\t\"license_title\":
